function Todo(props){
    const src = props.concepts.image
    return(
        <div>
            <ul id="concepts">
                <li className="concept">
                    <img src={src} alt="TODO: TITLE" />
                    <h2>TODO: { props.concepts.title }</h2>
                    <p>TODO: { props.concepts.description }</p>
                </li>
            </ul>
        </div>
    )
}

export default Todo;
